Here is a sample code for a chrome extension that takes screenshots of the current tab and saves them to a folder on your computer:
```
// manifest.json
{
  "name": "Screenshot Extension",
  "version": "1.0",
  "description": "Takes screenshots of the current tab and saves them to a folder on your computer.",
  "manifest_version": 2,
  "background": {
    "scripts": ["background.js"]
  },
  "permissions": [
    "activeTab",
    "tabs",
    "storage"
  ]
}

// background.js
chrome.tabs.onUpdated.addListener(function(tabId, changeInfo, tab) {
  if (changeInfo.status === "complete") {
    chrome.tabs.captureVisibleTab(null, {}, function(dataUrl) {
      var filename = "screenshot-" + Date.now() + ".png";
      chrome.storage.local.set({filename: filename}, function() {
        chrome.downloads.download({
          url: dataUrl,
          filename: filename,
          saveAs: false
        });
      });
    });
  }
});

// settings.html
<!DOCTYPE html>
<html>
  <head>
    <title>Screenshot Extension Settings</title>
    <script src="settings.js"></script>
  </head>
  <body>
    <h1>Screenshot Extension Settings</h1>
    <form id="settings-form">
      <label for="folder">Folder:</label>
      <input type="text" id="folder" name="folder" value="">
      <button type="submit">Save</button>
    </form>
  </body>
</html>

// settings.js
document.addEventListener("DOMContentLoaded", function() {
  var form = document.getElementById("settings-form");
  form.addEventListener("submit", function(event) {
    event.preventDefault();
    var folder = document.getElementById("folder").value;
    chrome.storage.local.set({folder: folder}, function() {
      console.log("Settings saved");
    });
  });
});

// content_script.js
chrome.runtime.onMessage.addListener(function(request, sender, sendResponse) {
  if (request.action === "takeScreenshot") {
    chrome.tabs.captureVisibleTab(null, {}, function(dataUrl) {
      var filename = "screenshot-" + Date.now() + ".png";
      chrome.storage.local.get("folder", function(result) {
        var folder = result.folder;
        chrome.downloads.download({
          url: dataUrl,
          filename: folder + "/" + filename,
          saveAs: false
        });
      });
    });
  }
});
```
